CREATE FUNCTION [dbo].[HcCapsTable]
(
	@checkPeriodStart date,
	@checkPeriodEnd date
	
)
RETURNS table
AS
return

with hcs as ( select t1.ClientId, t1.StartDate, t4.StartDate as EndDate, coalesce(t2.Cap, 0) as Cap, t1.HcStatusId from ClientHcStatuses as t1 join HcStatuses as t2 on t1.HcStatusId = t2.Id outer apply ( select top 1 startdate from ClientHcStatuses as t3 where t3.ClientId = t1.ClientId and t3.StartDate > t1.StartDate order by t3.StartDate ) as t4 ), fs as ( select * from ( select s.ClientId, fl.HcHoursLimit, fl.SubstractGovHours, s.FunctionalityLevelId, cast(s.StartDate as date) as StartDate, cast((select min(startdate) from FunctionalityScores as e where s.clientid = e.clientid and s.StartDate < e.StartDate) as date) as EndDate from FunctionalityScores as s join FunctionalityLevels as fl on s.functionalitylevelid = fl.id ) as fs1 ), ghc as( select gov1.ClientId, gov1.Value, cast(gov1.StartDate as date) as StartDate, cast((select min(gov2.StartDate) from GovHcHours as gov2 where gov1.ClientId = gov2.ClientId and gov1.StartDate < gov2.StartDate) as date) as EndDate from GovHcHours as gov1 ), hcep as ( select ClientId, cast(StartDate as date) as StartDate, cast(EndDate as date) as EndDate from HomeCareEntitledPeriod ), gfh as( select gf1.ClientId, gf1.Value, cast(gf1.StartDate as date) as StartDate, cast((select min(gf2.StartDate) from GrandfatherHours as gf2 where gf1.ClientId = gf2.ClientId and gf1.StartDate < gf2.StartDate) as date) as EndDate from GrandfatherHours as gf1 ), c as ( select clients.Id as ClientId, a.GroupId as AgencyGroupId, cast(JoinDate as date) as JoinDate, cast(LeaveDate as date) as LeaveDate, cast(DeceasedDate as date) as DeceasedDate, MAFDate, MAF105Date ,Has2Date --by IZ --,GfHours from dbo.Clients join dbo.Agencies as a on dbo.clients.AgencyId = a.Id ), combined as ( select distinct ClientId ,AgencyGroupId ,JoinDate ,LeaveDate ,DeceasedDate ,SubstractGovHours --added by Lena ,FunctionalityLevelId ,FSHours ,HasStatusId ,HasHours ,GovHours ,gfhours ,gfstartdate --29 ,gfenddate --29 ,MAFDate ,MAF105Date ,HAS2Date --by IZ ,StartDate ,EndDate from ( select c.ClientId as ClientId, c.AgencyGroupId, c.JoinDate, c.LeaveDate, c.DeceasedDate, fs.SubstractGovHours, fs.FunctionalityLevelId, fs.HcHoursLimit as FSHours, hcs.HcStatusId as HasStatusId, hcs.Cap as HasHours, ghc.Value as GovHours, gfh.Value as gfhours, gfh.StartDate as gfstartdate, --29 gfh.EndDate as gfenddate, --29 mafdate, maf105date, has2date, --by IZ (select max(mxsd.StartDate) from ( select fs.startDate as StartDate union select hcs.StartDate union select hcep.startDate union select ghc.StartDate union --select gfh.StartDate union --select c.MAFDate union --select c.MAF105Date union select c.JoinDate ) as mxsd ) as StartDate, (select min(mxsd.EndDate) from ( select fs.EndDate as EndDate union select hcs.EndDate union select hcep.EndDate union select ghc.EndDate union --select gfh.EndDate union select case when c.DeceasedDate is not null then DATEADD(day, (4 * 7) + 1, c.DeceasedDate) else case when c.LeaveDate is not null then DATEADD(day, 1, c.LeaveDate) else c.LeaveDate end end) as mxsd ) as EndDate from c join hcep on hcep.clientid=c.ClientId
join hcs on c.Clientid = hcs.clientid and ( (hcep.EndDate is null and hcs.EndDate is null) or (hcep.EndDate is null or isnull(hcep.EndDate,'') > hcs.StartDate) or --29 (hcs.EndDate is null or isnull(hcs.EndDate,'') > hcep.StartDate) --29 ) --cast(t.StartDate as date) join fs on c.Clientid = fs.clientid and ( (hcep.EndDate is null and fs.EndDate is null) or (hcep.EndDate is null or isnull(hcep.EndDate,'') > fs.StartDate) or --29 (fs.EndDate is null or isnull(fs.EndDate,'') > hcep.StartDate) --29 )-- join ghc on c.ClientId = ghc.ClientId and ( (hcep.EndDate is null and ghc.EndDate is null) or (hcep.EndDate is null or isnull(hcep.EndDate,'') > ghc.StartDate) or --29 (ghc.EndDate is null or isnull(ghc.EndDate,'') > hcep.StartDate) --29 )
left outer join gfh on gfh.ClientId = c.ClientId and ( --full outer join gfh on gfh.ClientId = c.ClientId and (
(hcep.EndDate is null and gfh.EndDate is null) or (hcep.EndDate is null or isnull(hcep.EndDate,'') > gfh.StartDate) or --29 (gfh.EndDate is null or isnull(gfh.EndDate,'') > hcep.StartDate ) --29 --EZ ) ) as t
where EndDate is null or isnull(EndDate,'') > isnull(StartDate,'')
), mafSplits as ( select ClientId ,AgencyGroupId ,JoinDate ,LeaveDate ,DeceasedDate ,FunctionalityLevelId ,SubstractGovHours --added by Lena ,FSHours ,HasStatusId ,HasHours ,GovHours ,gfhours ,gfstartdate ,gfenddate ,MAFDate ,MAF105Date ,HAS2Date -- by IZ ,(select max(StartDate) from (select t.StartDate union select maf.StartDate union select Maf105.StartDate union select Has2.StartDate union select GF2.StartDate ) as maxt) as StartDate ,(select min(EndDate) from (select t.EndDate union select maf.EndDate union select Maf105.EndDate union select Has2.EndDate union select GF2.EndDate ) as maxt) as EndDate from combined as t --maf & maf105 should split each hc period outer apply ( select StartDate, EndDate, [Value] from ( select null as StartDate, MAFDate as EndDate, 0 as [Value] union select MafDate as StartDate, null as EndDate, 1 as [Value] ) as m where (t.EndDate is not null and m.StartDate between t.StartDate and t.EndDate) or (t.EndDate is null and t.StartDate < m.StartDate) or (t.EndDate is not null and m.EndDate between t.StartDate and t.EndDate) or (t.EndDate is null and t.StartDate < isnull(m.EndDate, ''))
) as maf
outer apply ( select StartDate, EndDate, [Value] from ( select null as StartDate, Maf105Date as EndDate, 0 as [Value] union select Maf105Date as StartDate, null as EndDate, 1 as [Value] ) as m where (t.EndDate is not null and m.StartDate between t.StartDate and t.EndDate) or (t.EndDate is null and t.StartDate < m.StartDate) or (t.EndDate is not null and m.EndDate between t.StartDate and t.EndDate) or (t.EndDate is null and t.StartDate < isnull(m.EndDate, '')) ) as Maf105 outer apply ( --byIZ select StartDate, EndDate, [Value] from ( select null as StartDate, Has2Date as EndDate, 0 as [Value] union select Has2Date as StartDate, null as EndDate, 1 as [Value] ) as m where (t.EndDate is not null and m.StartDate between t.StartDate and t.EndDate) or (t.EndDate is null and t.StartDate < m.StartDate) or (t.EndDate is not null and m.EndDate between t.StartDate and t.EndDate) or (t.EndDate is null and t.StartDate < m.EndDate) ) as Has2 outer apply ( --29 select StartDate, EndDate, [Value] from ( select null as StartDate, gfstartdate as EndDate, 0 as [Value] union select gfstartdate as StartDate, null as EndDate, 1 as [Value] ) as m where (t.EndDate is not null and m.StartDate between t.StartDate and t.EndDate) or (t.EndDate is null and t.StartDate <m.StartDate) or (t.EndDate is not null and m.EndDate between t.StartDate and t.EndDate) or (t.EndDate is null and t.StartDate < m.EndDate) ) as GF2
) ,mafs as ( select t.ClientId ,t.HasStatusId ----Mike code --,case when startdate < MAFDate then 0 else 1 end as Maf --,case when StartDate < MAF105Date then 0 else 1 end as Maf105 ---Elvira changed: ,case when Isnull(MAFDate,'') = '' then 0 when startdate < MAFDate then 0 else 1 end as Maf ,case when Isnull(MAF105Date,'') = '' then 0 when StartDate < isnull(MAF105Date,'') then 0 else 1 end as Maf105 -- ,case when Isnull(Has2Date,'') = '' then 0 --by IZ -- when StartDate < isnull(Has2Date,'') then 0 else 1 end as Has ,case when Isnull(Has2Date,'') = '' then 0 when StartDate < isnull(Has2Date,'') then 0 else 1 end as Has2 --by LK --else 1 end as Has2
-- ,t.FSHours ,t.GovHours ,case when Isnull(t.gfstartdate,'') = '' then 0 when StartDate < isnull(gfstartdate,'') then 0 else t.gfhours end as gfhours --29 --,t.gfhours ,t.HasHours ,t.FunctionalityLevelId ,t.SubstractGovHours --added by Lena ,t.StartDate ,t.EndDate ,t.AgencyGroupId ,t.JoinDate ,t.LeaveDate ,t.DeceasedDate from mafSplits as t where t.EndDate is null or t.StartDate < t.EndDate
