CREATE FUNCTION [dbo].[HcCapWithoutCarry]
(
	@clientId int,
	@checkPeriodStart datetime,
	@checkPeriodEnd datetime
)
RETURNS decimal(19,4) 
AS

--this will hold import key - app key pairs
declare @t table (id int, rowid int); with import as ( select * from AppsImport where id = @id and StartDate is not null and EndDate is not null ) merge dbo.apps as target using ( --get only apps with unique name and valid fks (inner join) select i.* from (select name from import group by name having count(*)=1) as iname join import as i on iname.name = i.name join funds on i.fundid = funds.id join agencygroups on i.agencygroupid = agencygroups.id join currencies as c on i.currencyid = c.id ) as source on target.name = source.name when matched then update set FundId = source.FundId ,AgencyGroupId = source.AgencyGroupId ,Name = source.Name ,CurrencyId = source.CurrencyId ,AgencyContribution = source.AgencyContribution ,CcGrant = source.CcGrant ,RequiredMatch = source.RequiredMatch ,StartDate = source.StartDate ,EndDate = source.EndDate ,MaxAdminAmount = source.MaxAdminAmount ,MaxNonHcAmount = source.MaxNonHcAmount ,HistoricalExpenditureAmount = source.HistoricalExpenditureAmount ,EndOfYearValidationOnly = source.EndOfYearValidationOnly ,InterlineTransfer = source.InterlineTransfer ,AvgReimbursementCost = source.AvgReimbursementCost when not matched by target then insert (FundId ,AgencyGroupId ,CurrencyId ,Name ,AgencyContribution ,CcGrant ,RequiredMatch ,MaxAdminAmount ,MaxNonHcAmount ,HistoricalExpenditureAmount ,StartDate ,EndDate ,EndOfYearValidationOnly ,InterlineTransfer ,AvgReimbursementCost) values(source.FundId ,source.AgencyGroupId ,source.CurrencyId ,source.Name ,source.AgencyContribution ,source.CcGrant ,source.RequiredMatch ,source.MaxAdminAmount ,source.MaxNonHcAmount ,source.HistoricalExpenditureAmount ,source.StartDate ,source.EndDate ,source.EndOfYearValidationOnly ,source.InterlineTransfer ,source.AvgReimbursementCost) output inserted.id, source.RowId into @t;
set nocount on
merge dbo.appExchangeRates as target using ( --get ids of affected rows in prev merge and join the exchange rates select t1.id as appid, t2.currencyid, t2.value from @t as t1 join ( select rowid, upper(substring(cur,1,3)) as currencyid, val as Value from AppsImport unpivot ( val for cur in (USDRate,ILSRate,EURRate) ) as u ) as t2 on t1.rowid = t2.rowid ) as source on target.appid = source.appid and target.curid = source.currencyid when matched and source.value is not null then update set value = source.value when not matched by target then insert (appid, curid, value) values(source.appid, source.currencyid, source.value) when matched and source.Value is null then delete when not matched by source then delete;
delete tar from AppsImport as tar join @t as t on tar.rowid = t.rowid
RETURN 0

CREATE PROCEDURE [dbo].[ImportApps]
	@id uniqueidentifier
AS

declare @importId uniqueidentifier select @importid = @id declare @t table (Id int, ClientId int);
merge CfsRows as target using (
select min(t.id) as Id, t.ClientId, t.StartDate, t.CfsApproved, t.UpdatedAt, t.UpdatedBy from ImportHcep as t join ( select clientsInnerTable.* from dbo.clients as clientsInnerTable join Agencies as a on clientsInnerTable.AgencyId = a.Id join AgencyGroups as ag on a.GroupId = ag.Id join Countries as country on ag.CountryId = country.Id and coalesce(@agencyId,clientsInnerTable.agencyId) = clientsInnerTable.agencyId and coalesce(@agencyGroupId, a.GroupId) = a.GroupId and coalesce(@regionId, country.RegionId) = country.RegionId ) as c on t.ClientId = c.Id where t.ImportId = @importId group by t.ClientId, t.StartDate, t.CfsApproved, t.UpdatedAt, t.UpdatedBy ) as source on (target.ClientId = source.ClientId and (target.StartDate is null or (select COUNT(*) from CfsRows where ClientId = source.ClientId) = 1)) when matched and (target.EndDate is null or target.EndDate > source.StartDate) then Update set target.StartDate = source.StartDate, target.UpdatedAt = source.UpdatedAt, target.UpdatedById = source.UpdatedBy, target.CfsApproved = case when target.CfsApproved is null and source.CfsApproved is null then source.StartDate when target.CfsApproved is null and source.CfsApproved is not null then source.CfsApproved else target.CfsApproved end output source.Id, source.ClientId into @t;
delete s from ImportHcep as s join @t as t on s.Id = t.Id
if not exists (select top 1 1 from ImportHcep where ImportId = @importId) begin delete from Imports where Id=@importId; end
select @@ROWCOUNT RETURN 0

CREATE PROCEDURE [dbo].[ImportCfsProc]
(
	@id uniqueidentifier,
	@agencyId int,
	@agencyGroupId int,
	@regionId int
)
AS

declare @t table( Id int, NationalId nvarchar(50), AgencyId int, FirstName nvarchar(50), LastName nvarchar(50), OldApprovalStatusId int, NewApprovalStatusId int, LeaveReasonId int null, CountryId int, BirthCountryId int, DeceasedDate datetime null
); declare @t2 table( Id int, OldHcStatusId int );
declare @d datetime = getdate();
insert into @t2 (id, OldHcStatusId) select importclients.ClientId, (select top 1 HcStatusId from dbo.ClientHcStatuses as e where e.ClientId = ImportClients.ClientId order by e.StartDate desc) from ImportClients where ImportClients.ImportId = @importid
merge clients as target using ( select importclients.id, importclients.ClientId, fundstatuses.id as FundStatusId, approvalstatuses.id as ApprovalStatusId, importclients.UpdatedById, importclients.LeaveReasonId, importclients.DeceasedDate from ImportClients join FundStatuses on importclients.fundstatusid = fundstatuses.id join approvalstatuses on fundstatuses.approvalstatusname = approvalstatuses.name where ImportClients.ImportId = @importid ) as source on target.Id = source.ClientId when matched then update set FundstatusId = source.FundStatusId, ApprovalStatusId = source.ApprovalStatusId, UpdatedById = source.UpdatedById, UpdatedAt = @d, ApprovalStatusUpdated = @d output inserted.id, inserted.NationalId, inserted.AgencyId, inserted.FirstName, inserted.LastName, deleted.ApprovalStatusId, inserted.ApprovalStatusId, inserted.LeaveReasonId, inserted.CountryId, inserted.BirthCountryId, inserted.DeceasedDate
into @t;
delete i from importclients as i join @t as t on i.id = t.id where i.ImportId = @importId;
if not exists (select top 1 1 from imports where imports.id = @importId) begin delete from imports where imports.id = @importId; end
select t.Id as ClientId, t.NationalId, t.FirstName, t.LastName, t.NewApprovalStatusId, t.OldApprovalStatusId, a.Id as AgencyId, a.GroupId as AgencyGroupId, t.LeaveReasonId, t.DeceasedDate ,hc.HcStatusName as HcStatusName ,t2.OldHcStatusId ,hc.HcStatusId as NewHcStatusId ,cntry.Name as CountryName ,bcntry.Name as BirthCountryName
from @t as t join Agencies as a on t.AgencyId = a.id left outer join @t2 as t2 on t.id = t2.Id left outer join Countries as cntry on t.CountryId = cntry.Id left outer join BirthCountries as bcntry on t.BirthCountryId = bcntry.Id outer apply ( select top 1 HcStatusId, ext2.Name as HcStatusName from dbo.ClientHcStatuses as ext1 join dbo.HcStatuses as ext2 on ext1.HcStatusId = ext2.Id where ext1.ClientId = t.Id order by ext1.StartDate desc ) as hc where (t.NewApprovalStatusId <> t.OldApprovalStatusId) or (t.NewApprovalStatusId is null and t.OldApprovalStatusId is not null) or (t.NewApprovalStatusId is not null and t.OldApprovalStatusId is null) or (t2.OldHcStatusId <> hc.HcStatusId) or (t2.OldHcStatusId is null and hc.HcStatusId is not null) or (t2.OldHcStatusId is not null and hc.HcStatusId is null)
RETURN 0

CREATE PROCEDURE [dbo].[ImportClientFundStatusProc]
	@importId uniqueidentifier
AS

BEGIN
declare @idLocal uniqueidentifier; set @idLocal = newid(); set @idLocal = @Id;
declare @t table (Id uniqueidentifier);
merge clientreports as target using ( select t1.Id, t1.SubReportId, t1.ClientId, t1.Quantity, t1.TotalAmount as Amount, t1.Remarks as Remarks from ImportClientReports as t1 join --unique (subreportid, clientid), take first row out of duplicates ( Select SubReportId, ClientId, min(RowIndex) as RowIndex from ImportClientReports where ImportId = @idLocal group by SubReportId, ClientId )as t2 on t1.SubReportId = t2.SubReportId and t1.ClientId=t2.ClientId and t1.RowIndex = t2.RowIndex join clients on t1.clientid = clients.id join subreports on t1.subreportid = subreports.id join mainreports on subreports.mainreportid = mainreports.id where t1.ImportId = @idLocal and dbo.fnRepDateValid(clients.leavedate, clients.deceaseddate, mainreports.[start], t1.remarks, iif(clients.AustrianEligible=1 or clients.RomanianEligible=1,1,0)) = 1
) as source on target.SubReportId = source.SubReportId and target.ClientId = source.ClientId when matched then Update set Quantity = source.Quantity, Amount = source.Amount, Remarks = source.Remarks
when not matched by target then Insert (SubReportId, ClientId, Quantity, Amount, Remarks) Values (source.SubReportId, source.ClientId, source.Quantity, source.Amount, source.Remarks) output source.Id into @t;
delete s from importclientreports as s join @t as t on s.Id = t.Id
if not exists (select top 1 1 from importClientReports as i where i.ImportId=@idLocal and i.ReportTypeId=6) begin delete from ImportClientReports where Id = @idLocal; end
SELECT @@ROWCOUNT END

