CREATE PROCEDURE dbo.InsertClient

@Id int  ,
@FirstName nvarchar(255),
@LastName nvarchar(255),

@JoinDate smalldatetime ,
@ApprovalStatusId int ,
@UpdatedById int ,
@UpdatedAt smalldatetime ,
@CreatedAt smalldatetime 
	
AS

begin set nocount on
begin if Update(StatusId) begin insert INTO dbo.MainReportStatusAudits ( MainReportId, OldStatusId, NewStatusId, StatusChangeDate, UserId ) select i.Id, d.StatusId, i.StatusId, i.updatedat, i.updatedbyId
from inserted as i join deleted as d on i.id=d.id --where i.StatusId <> d.StatusId
end
if exists(SELECT top 2 * FROM MainReportStatusAudits WHERE StatusChangeDate IN ( SELECT StatusChangeDate FROM MainReportStatusAudits GROUP BY StatusChangeDate HAVING COUNT(*) > 1) order by StatusChangeDate desc, Id desc)
delete from MainReportStatusAudits where id = (SELECT max(id) FROM MainReportStatusAudits WHERE StatusChangeDate IN ( SELECT StatusChangeDate FROM MainReportStatusAudits GROUP BY StatusChangeDate HAVING COUNT(*) > 1) ) end
----------------------------------------------------------- hccaps --------------------add submitted quantities merge dbo.hccaps as target using ( select t.clientid, t.reportdate, q, oa.hccap, oa.avghccap from ( select clientid, reportdate, sum(ar.quantity) as q from ClientAmountReport as ar join ClientReports as cr on ar.ClientReportId = cr.Id join SubReports as sr on cr.SubReportId = sr.Id join inserted on sr.mainreportid = inserted.id join deleted on inserted.id = deleted.id join AppBudgetServices as appbs on sr.AppBudgetServiceId = appbs.id join Services as s on appbs.ServiceId = s.Id where s.EnforceTypeConstraints = 1 and s.TypeId = 8 and s.ReportingMethodId in (5, 14) and dbo.fnMainReportSubmitted(deleted.statusid) = 0 and dbo.fnMainReportSubmitted(inserted.statusid) = 1 group by clientid, reportdate ) as t outer apply dbo.fnHcCapMonthly(t.clientid, t.reportdate) as oa ) as source on target.clientid = source.clientid and target.reportdate = source.reportdate when not matched by target then insert (clientid, reportdate, quantity, monthlycap, dailycap) values(source.clientid, source.reportdate, source.q, coalesce(source.hccap,0), coalesce(source.avghccap,0)) when matched then update set quantity = target.quantity + source.q;
--------------------substract unsubmitted quantities merge dbo.hccaps as target using ( select t.clientid, t.reportdate, q, oa.hccap, oa.avghccap from ( select clientid, reportdate, sum(ar.quantity) as q from ClientAmountReport as ar join ClientReports as cr on ar.ClientReportId = cr.Id join SubReports as sr on cr.SubReportId = sr.Id join inserted on sr.mainreportid = inserted.id join deleted on inserted.id = deleted.id join AppBudgetServices as appbs on sr.AppBudgetServiceId = appbs.id join Services as s on appbs.ServiceId = s.Id where s.EnforceTypeConstraints = 1 and s.TypeId = 8 and s.ReportingMethodId in (5, 14) and dbo.fnMainReportSubmitted(deleted.statusid) = 1 and dbo.fnMainReportSubmitted(inserted.statusid) = 0 group by clientid, reportdate ) as t outer apply dbo.fnHcCapMonthly(t.clientid, t.reportdate) as oa ) as source on target.clientid = source.clientid and target.reportdate = source.reportdate when matched and target.quantity = source.q then delete when matched and target.quantity <> source.q then update set quantity = target.quantity - source.q;
end

CREATE PROCEDURE [dbo].[NewClientsExport]
	@approvalStatusId int
AS

	declare		
		@Admin int =1,
		@AgencyUser int =2,
		@AgencyOfficer int =4,
		@RegionOfficer int =8,
		@GlobalOfficer int =16,
		@Ser int =32,
        @RegionAssistant int =64,
        @BMF int =128,
        @GlobalReadOnly int =256,
        @RegionReadOnly int =512,
        @AuditorReadOnly int =1024,
		@AgencyUserAndReviewer int =16384,
		@SerAndReviewer int =32768

	declare @role int,
		@userAgencyId int,
		@userAgencyGroupId int,
		@userRegionId int

	select @role = users.RoleId,
		@userAgencyId = users.AgencyId,
		@userAgencyGroupId = users.AgencyGroupId,
		@userRegionId = users.RegionId
	from Users 
	where Id = @userId

	;with tagencies as (
		select * from dbo.agencies where 
		(not (@role = @AgencyUser or @role = @AgencyUserAndReviewer or @role = @AgencyOfficer)) or @useragencyId = id
	), tagencygroups as (
		select ag.* 
		from dbo.agencygroups as ag
		join dbo.countries as c on ag.CountryId = c.Id
		where
			case when @role = @ser or @role = @SerAndReviewer
					then case when @userAgencyGroupId = ag.id then 1 end
				when @role = @RegionOfficer or @role = @RegionAssistant
					then case when exists(select top 1 1 from dbo.useragencygroups where userid = @userId and AgencyGroupId = ag.id) then 1 end
				when @role = @RegionReadOnly then 
					case when c.RegionId = @userRegionId then 1 end
				else 1 end = 1
	), tmainreports as (
		select Id
		from mainreports
		where dbo.fnMainReportSubmitted(statusid) = 1
	), ghc as(
		select gov1.ClientId, gov1.[Value], 
		cast(gov1.StartDate as date) as StartDate, 
		cast((select min(gov2.StartDate) from GovHcHours as gov2 where gov1.ClientId = gov2.ClientId and gov1.StartDate < gov2.StartDate) as date) as EndDate
		from GovHcHours as gov1
	), cras as (
		select cr.ClientId, co.RegionId, ag.Id as AgencyGroupId, ag.Name as AgencyGroupName, cra.ReportDate, cra.Quantity as Amount,
			dbo.GetWeekNumber(cra.ReportDate, coalesce(ap.WeekStartDay, 0)) as WeekNumber,
			gh.[Value] as GovHours, DATEPART(YEAR, cra.ReportDate) as [Year], DATENAME(MONTH, cra.ReportDate) as Month
		from tmainreports mr
			join SubReports sr on mr.Id = sr.MainReportId
			join ClientReports cr on sr.Id = cr.SubReportId
			join ClientAmountReport cra on cr.Id = cra.ClientReportId
			join AppBudgetServices appbs on sr.AppBudgetServiceId = appbs.Id
			join AppBudgets appb on appbs.AppBudgetId = appb.Id
			join Services s on appbs.ServiceId = s.Id
			join Clients c on cr.ClientId = c.Id
			join tagencies a on c.AgencyId = a.Id
			join tagencygroups ag on a.GroupId = ag.Id
			join Countries co on ag.CountryId = co.Id
			outer apply (select iap.* from agencyapps iap
						join agencies ia on iap.agencyid = ia.id
						join agencygroups iag on ia.groupid = iag.id
						where iag.id = ag.id and iap.appid = appb.appid) as ap
			outer apply (select top 1 * from ghc where ClientId = cr.ClientId and (EndDate is null or EndDate > cra.ReportDate) and StartDate < DATEADD(day, 7, cra.ReportDate) order by StartDate desc) as gh
		where s.ReportingMethodId = 14 /*homecare weekly*/ and
			(@regionId is null or @regionId = 0 or co.RegionId = @regionId) and
			(@agencyGroupId is null or ag.Id = @agencyGroupId) and
			(@year is null or DATEPART(YEAR, cra.ReportDate) = @year) and
			(@term is null or ag.Name like @term + '%')
	), q as (select MIN(cr.AgencyGroupId) as AgencyGroupId, MIN(cr.AgencyGroupName) as AgencyGroupName, cr.Year, MIN(cr.Month) as [Month], cr.ClientId, (SUM(cr.Amount) + coalesce(MIN(cr.GovHours), 0)) as TotalHours,
			SUM(cr.Amount) as ReportedHours, coalesce(MIN(cr.GovHours), 0) as GovHours, MIN(cr.RegionId) as RegionId, MIN(cr.ReportDate) as ReportDate, cr.WeekNumber as [Week] 
		from cras cr
		group by cr.ClientId, cr.Year, cr.WeekNumber
	), res as (
		select  AgencyGroupId, AgencyGroupName, [Year], [Month], ClientId, TotalHours, ReportedHours, GovHours, RegionId, ReportDate, [Week],
		row_number() over (
			order by ClientId, ReportDate
		) as rn
		from q
		where TotalHours > 105
	)
	select AgencyGroupId, AgencyGroupName, [Year], [Month], ClientId, TotalHours, ReportedHours, GovHours, RegionId, ReportDate, [Week]
	from res
	where rn between @skip + 1 and @skip + @top
	order by rn
RETURN 0

CREATE PROCEDURE [dbo].[PopulateScReport]
	@subReportId int
AS

declare @t table (id int); update c set UpdatedById = (select top 1 id from dbo.users where username='sysadmin' or username = 'ccdevadmin'), UpdatedAt = getdate(), LeaveReasonId = 3 /*other*/, LeaveDate = DATEADD(day, 3, l.UpdateDate), AdministrativeLeave = 1, LeaveRemarks = 'not eligible' output inserted.Id into @t from dbo.Clients as c join approvalstatuses on c.ApprovalStatusId = ApprovalStatuses.Id outer apply ( select MAX(updatedate) as UpdateDate from dbo.History as h where h.ReferenceId = c.Id and h.TableName='Clients' and h.FieldName = 'ApprovalStatusId' ) as l where ApprovalStatuses.Id = 4 and c.LeaveDate is null and (c.AutoLeaveOverride is null or CONVERT(date, c.AutoLeaveOverride) < CONVERT(date, getdate())) and DATEDIFF(HOUR, l.UpdateDate, GETDATE()) > 72
;merge ClientHcStatuses as t using ( select * from ( select c.ID as ClientId, --first hc record backdated to the join date (typically after first fund status update of a new client) case when exists (select top 1 1 from dbo.clienthcstatuses as i2 where i2.clientid = c.Id) then cast(getdate() as date) else c.JoinDate end as Startdate, c.joinDate, c.ApprovalStatusId, c.FundStatusId, c.BirthCountryId, c.CountryId, dbo.fnHomecareApprovalStatusId(c.FundStatusId, c.ApprovalStatusId, c.BirthCountryId, c.CountryId) as HcStatusId from @t AS p join clients as c on p.id = c.Id ) as i1 ) as s on t.ClientId = s.ClientId and t.StartDate = s.StartDate when not matched by target then insert (clientid, ApprovalStatusId, FundStatusId, BirthCountryId, CountryId, HcStatusId, StartDate) values (s.ClientId, s.ApprovalStatusId, s.FundStatusId, BirthCountryId, CountryId, s.HcStatusId, s.StartDate) when matched then update set HcStatusId = s.HcStatusId, ApprovalStatusId = s.ApprovalStatusId, FundStatusId = s.FundStatusId, BirthCountryId = s.BirthCountryId, CountryId = s.CountryId ;
select * from @t RETURN 0

